//doc.rust-lang.org/nightly/core/ops/arith/trait.Neg.html#associatedtype.Output\" class=\"associatedtype\">Output</a> = <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section></summary><div class='docblock'>The resulting type after applying the <code>-</code> operator.</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.neg\" class=\"method trait-impl\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><a href=\"#method.neg\" class=\"anchor\">§</a><h4 class=\"code-header\">fn <a href=\"https://doc.rust-lang.org/nightly/core/ops/arith/trait.Neg.html#tymethod.neg\" class=\"fn\">neg</a>(self) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section></summary><div class='docblock'>Performs the unary <code>-</code> operation. <a href=\"https://doc.rust-lang.org/nightly/core/ops/arith/trait.Neg.html#tymethod.neg\">Read more</a></div></details></div></details>","Neg","bracket_terminal::prelude::PointF"],["<details class=\"toggle implementors-toggle\" open><summary><section id=\"impl-PartialEq-for-Vec2\" class=\"impl\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><a href=\"#impl-PartialEq-for-Vec2\" class=\"anchor\">§</a><h3 class=\"code-header\">impl <a class=\"trait\" href=\"https://doc.rust-lang.org/nightly/core/cmp/trait.PartialEq.html\" title=\"trait core::cmp::PartialEq\">PartialEq</a> for <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h3></section></summary><div class=\"impl-items\"><details class=\"toggle method-toggle\" open><summary><section id=\"method.eq\" class=\"method trait-impl\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><a href=\"#method.eq\" class=\"anchor\">§</a><h4 class=\"code-header\">fn <a href=\"https://doc.rust-lang.org/nightly/core/cmp/trait.PartialEq.html#tymethod.eq\" class=\"fn\">eq</a>(&amp;self, other: &amp;<a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a>) -&gt; <a class=\"primitive\" href=\"https://doc.rust-lang.org/nightly/std/primitive.bool.html\">bool</a></h4></section></summary><div class='docblock'>This method tests for <code>self</code> and <code>other</code> values to be equal, and is used\nby <code>==</code>.</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.ne\" class=\"method trait-impl\"><span class=\"rightside\"><span class=\"since\" title=\"Stable since Rust version 1.0.0\">1.0.0</span> · <a class=\"src\" href=\"https://doc.rust-lang.org/nightly/src/core/cmp.rs.html#263\">source</a></span><a href=\"#method.ne\" class=\"anchor\">§</a><h4 class=\"code-header\">fn <a href=\"https://doc.rust-lang.org/nightly/core/cmp/trait.PartialEq.html#method.ne\" class=\"fn\">ne</a>(&amp;self, other: <a class=\"primitive\" href=\"https://doc.rust-lang.org/nightly/std/primitive.reference.html\">&amp;Rhs</a>) -&gt; <a class=\"primitive\" href=\"https://doc.rust-lang.org/nightly/std/primitive.bool.html\">bool</a></h4></section></summary><div class='docblock'>This method tests for <code>!=</code>. The default implementation is almost always\nsufficient, and should not be overridden without very good reason.</div></details></div></details>","PartialEq","bracket_terminal::prelude::PointF"],["<details class=\"toggle implementors-toggle\" open><summary><section id=\"impl-Slerp%3Cf32%3E-for-Vec2\" class=\"impl\"><a class=\"src rightside\" href=\"src/ultraviolet/interp.rs.html#215-219\">source</a><a href=\"#impl-Slerp%3Cf32%3E-for-Vec2\" class=\"anchor\">§</a><h3 class=\"code-header\">impl <a class=\"trait\" href=\"ultraviolet/interp/trait.Slerp.html\" title=\"trait ultraviolet::interp::Slerp\">Slerp</a>&lt;<a class=\"primitive\" href=\"https://doc.rust-lang.org/nightly/std/primitive.f32.html\">f32</a>&gt; for <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h3></section></summary><div class=\"impl-items\"><details class=\"toggle method-toggle\" open><summary><section id=\"method.slerp\" class=\"method trait-impl\"><a class=\"src rightside\" href=\"src/ultraviolet/interp.rs.html#215-219\">source</a><a href=\"#method.slerp\" class=\"anchor\">§</a><h4 class=\"code-header\">fn <a href=\"ultraviolet/interp/trait.Slerp.html#tymethod.slerp\" class=\"fn\">slerp</a>(&amp;self, end: <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a>, t: <a class=\"primitive\" href=\"https://doc.rust-lang.org/nightly/std/primitive.f32.html\">f32</a>) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section></summary><div class=\"docblock\"><p>Spherical-linear interpolation between <code>self</code> and <code>end</code> based on <code>t</code> from 0.0 to 1.0.</p>\n<p><code>self</code> and <code>end</code> should both be normalized or something bad will happen!</p>\n<p>The implementation for SIMD types also requires that the two things being interpolated between\nare not exactly aligned, or else the result is undefined.</p>\n<p>Basically, interpolation that maintains a constant angular velocity\nfrom one orientation on a unit hypersphere to another. This is sorta the “high quality” interpolation\nfor <code>Rotor</code>s, and it can also be used to interpolate other things, one example being interpolation of\n3d normal vectors.</p>\n<p>Note that you should often normalize the result returned by this operation, when working with <code>Rotor</code>s, etc!</p>\n</div></details></div></details>","Slerp<f32>","bracket_terminal::prelude::PointF"],["<details class=\"toggle implementors-toggle\" open><summary><section id=\"impl-Sub-for-Vec2\" class=\"impl\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><a href=\"#impl-Sub-for-Vec2\" class=\"anchor\">§</a><h3 class=\"code-header\">impl <a class=\"trait\" href=\"https://doc.rust-lang.org/nightly/core/ops/arith/trait.Sub.html\" title=\"trait core::ops::arith::Sub\">Sub</a> for <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h3></section></summary><div class=\"impl-items\"><details class=\"toggle\" open><summary><section id=\"associatedtype.Output\" class=\"associatedtype trait-impl\"><a href=\"#associatedtype.Output\" class=\"anchor\">§</a><h4 class=\"code-header\">type <a href=\"https://doc.rust-lang.org/nightly/core/ops/arith/trait.Sub.html#associatedtype.Output\" class=\"associatedtype\">Output</a> = <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section></summary><div class='docblock'>The resulting type after applying the <code>-</code> operator.</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.sub\" class=\"method trait-impl\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><a href=\"#method.sub\" class=\"anchor\">§</a><h4 class=\"code-header\">fn <a href=\"https://doc.rust-lang.org/nightly/core/ops/arith/trait.Sub.html#tymethod.sub\" class=\"fn\">sub</a>(self, rhs: <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a>) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section></summary><div class='docblock'>Performs the <code>-</code> operation. <a href=\"https://doc.rust-lang.org/nightly/core/ops/arith/trait.Sub.html#tymethod.sub\">Read more</a></div></details></div></details>","Sub","bracket_terminal::prelude::PointF"],["<details class=\"toggle implementors-toggle\" open><summary><section id=\"impl-SubAssign-for-Vec2\" class=\"impl\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><a href=\"#impl-SubAssign-for-Vec2\" class=\"anchor\">§</a><h3 class=\"code-header\">impl <a class=\"trait\" href=\"https://doc.rust-lang.org/nightly/core/ops/arith/trait.SubAssign.html\" title=\"trait core::ops::arith::SubAssign\">SubAssign</a> for <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h3></section></summary><div class=\"impl-items\"><details class=\"toggle method-toggle\" open><summary><section id=\"method.sub_assign\" class=\"method trait-impl\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><a href=\"#method.sub_assign\" class=\"anchor\">§</a><h4 class=\"code-header\">fn <a href=\"https://doc.rust-lang.org/nightly/core/ops/arith/trait.SubAssign.html#tymethod.sub_assign\" class=\"fn\">sub_assign</a>(&amp;mut self, rhs: <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a>)</h4></section></summary><div class='docblock'>Performs the <code>-=</code> operation. <a href=\"https://doc.rust-lang.org/nightly/core/ops/arith/trait.SubAssign.html#tymethod.sub_assign\">Read more</a></div></details></div></details>","SubAssign","bracket_terminal::prelude::PointF"],["<details class=\"toggle implementors-toggle\" open><summary><section id=\"impl-Sum-for-Vec2\" class=\"impl\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><a href=\"#impl-Sum-for-Vec2\" class=\"anchor\">§</a><h3 class=\"code-header\">impl <a class=\"trait\" href=\"https://doc.rust-lang.org/nightly/core/iter/traits/accum/trait.Sum.html\" title=\"trait core::iter::traits::accum::Sum\">Sum</a> for <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h3></section></summary><div class=\"impl-items\"><details class=\"toggle method-toggle\" open><summary><section id=\"method.sum\" class=\"method trait-impl\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><a href=\"#method.sum\" class=\"anchor\">§</a><h4 class=\"code-header\">fn <a href=\"https://doc.rust-lang.org/nightly/core/iter/traits/accum/trait.Sum.html#tymethod.sum\" class=\"fn\">sum</a>&lt;I&gt;(iter: I) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a><div class=\"where\">where\n    I: <a class=\"trait\" href=\"https://doc.rust-lang.org/nightly/core/iter/traits/iterator/trait.Iterator.html\" title=\"trait core::iter::traits::iterator::Iterator\">Iterator</a>&lt;Item = <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a>&gt;,</div></h4></section></summary><div class='docblock'>Method which takes an iterator and generates <code>Self</code> from the elements by\n“summing up” the items.</div></details></div></details>","Sum","bracket_terminal::prelude::PointF"],["<details class=\"toggle implementors-toggle\" open><summary><section id=\"impl-Vec2\" class=\"impl\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><a href=\"#impl-Vec2\" class=\"anchor\">§</a><h3 class=\"code-header\">impl <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h3></section></summary><div class=\"impl-items\"><section id=\"method.new\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub const fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.new\" class=\"fn\">new</a>(x: <a class=\"primitive\" href=\"https://doc.rust-lang.org/nightly/std/primitive.f32.html\">f32</a>, y: <a class=\"primitive\" href=\"https://doc.rust-lang.org/nightly/std/primitive.f32.html\">f32</a>) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section><section id=\"method.broadcast\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub const fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.broadcast\" class=\"fn\">broadcast</a>(val: <a class=\"primitive\" href=\"https://doc.rust-lang.org/nightly/std/primitive.f32.html\">f32</a>) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section><section id=\"method.unit_x\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.unit_x\" class=\"fn\">unit_x</a>() -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section><section id=\"method.unit_y\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.unit_y\" class=\"fn\">unit_y</a>() -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section><details class=\"toggle method-toggle\" open><summary><section id=\"method.into_homogeneous_point\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.into_homogeneous_point\" class=\"fn\">into_homogeneous_point</a>(self) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec3/struct.Vec3.html\" title=\"struct ultraviolet::vec::vec3::Vec3\">Vec3</a></h4></section></summary><div class=\"docblock\"><p>Create a homogeneous 2d <em>point</em> from this vector interpreted as a point,\nmeaning the homogeneous component will start with a value of 1.0.</p>\n</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.into_homogeneous_vector\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.into_homogeneous_vector\" class=\"fn\">into_homogeneous_vector</a>(self) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec3/struct.Vec3.html\" title=\"struct ultraviolet::vec::vec3::Vec3\">Vec3</a></h4></section></summary><div class=\"docblock\"><p>Create a homogeneous 2d <em>vector</em> from this vector,\nmeaning the homogeneous component will always have a value of 0.0.</p>\n</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.from_homogeneous_point\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.from_homogeneous_point\" class=\"fn\">from_homogeneous_point</a>(v: <a class=\"struct\" href=\"ultraviolet/vec/vec3/struct.Vec3.html\" title=\"struct ultraviolet::vec::vec3::Vec3\">Vec3</a>) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section></summary><div class=\"docblock\"><p>Create a 2d point from a homogeneous 2d <em>point</em>, performing\ndivision by the homogeneous component. This should not be used\nfor homogeneous 2d <em>vectors</em>, which will have 0 as their\nhomogeneous component.</p>\n</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.from_homogeneous_vector\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.from_homogeneous_vector\" class=\"fn\">from_homogeneous_vector</a>(v: <a class=\"struct\" href=\"ultraviolet/vec/vec3/struct.Vec3.html\" title=\"struct ultraviolet::vec::vec3::Vec3\">Vec3</a>) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section></summary><div class=\"docblock\"><p>Create a 2d vector from homogeneous 2d <em>vector</em>, which simply\ndiscards the homogeneous component.</p>\n</div></details><section id=\"method.dot\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.dot\" class=\"fn\">dot</a>(&amp;self, other: <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a>) -&gt; <a class=\"primitive\" href=\"https://doc.rust-lang.org/nightly/std/primitive.f32.html\">f32</a></h4></section><details class=\"toggle method-toggle\" open><summary><section id=\"method.wedge\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.wedge\" class=\"fn\">wedge</a>(&amp;self, other: <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a>) -&gt; <a class=\"struct\" href=\"ultraviolet/bivec/struct.Bivec2.html\" title=\"struct ultraviolet::bivec::Bivec2\">Bivec2</a></h4></section></summary><div class=\"docblock\"><p>The wedge (aka exterior) product of two vectors.</p>\n<p>Note: Sometimes called “cross” product in 2D.\nSuch a product is not well defined in 2 dimensions\nand is really just shorthand notation for a hacky operation that\nextends the vectors into 3 dimensions, takes the cross product,\nthen returns only the resulting Z component as a pseudoscalar value.\nThis value is will have the same value as\nthe resulting bivector of the wedge product in 2d (a 2d\nbivector is also a kind of pseudoscalar value), so you may use\nthis product to calculate the same value.</p>\n<p>This operation results in a bivector, which represents\nthe plane parallel to the two vectors, and which has a\n‘oriented area’ equal to the parallelogram created by extending\nthe two vectors, oriented such that the positive direction is the\none which would move <code>self</code> closer to <code>other</code>.</p>\n</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.geom\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.geom\" class=\"fn\">geom</a>(&amp;self, other: <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a>) -&gt; <a class=\"struct\" href=\"ultraviolet/rotor/struct.Rotor2.html\" title=\"struct ultraviolet::rotor::Rotor2\">Rotor2</a></h4></section></summary><div class=\"docblock\"><p>The geometric product of this and another vector, which\nis defined as the sum of the dot product and the wedge product.</p>\n<p>This operation results in a ‘rotor’, named as such as it may define\na rotation. The rotor which results from the geometric product\nwill rotate in the plane parallel to the two vectors, by twice the angle between\nthem and in the opposite direction (i.e. it will rotate in the direction that would\nbring <code>other</code> towards <code>self</code>, and rotate in that direction by twice the angle between them).</p>\n</div></details><section id=\"method.rotate_by\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.rotate_by\" class=\"fn\">rotate_by</a>(&amp;mut self, rotor: <a class=\"struct\" href=\"ultraviolet/rotor/struct.Rotor2.html\" title=\"struct ultraviolet::rotor::Rotor2\">Rotor2</a>)</h4></section><section id=\"method.rotated_by\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.rotated_by\" class=\"fn\">rotated_by</a>(self, rotor: <a class=\"struct\" href=\"ultraviolet/rotor/struct.Rotor2.html\" title=\"struct ultraviolet::rotor::Rotor2\">Rotor2</a>) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section><section id=\"method.reflected\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.reflected\" class=\"fn\">reflected</a>(&amp;self, normal: <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a>) -&gt; <a class=\"struct\" href=\"ultraviolet/vec/vec2/struct.Vec2.html\" title=\"struct ultraviolet::vec::vec2::Vec2\">Vec2</a></h4></section><section id=\"method.mag_sq\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\">pub fn <a href=\"ultraviolet/vec/vec2/struct.Vec2.html#tymethod.mag_sq\" class=\"fn\">mag_sq</a>(&amp;self) -&gt; <a class=\"primitive\" href=\"https://doc.rust-lang.org/nightly/std/primitive.f32.html\">f32</a></h4></section><section id=\"method.mag\" class=\"method\"><a class=\"src rightside\" href=\"src/ultraviolet/vec/vec2.rs.html#740-744\">source</a><h4 class=\"code-header\